form_header.after_load:
function getTestQuestionByCode(test_header_code, question_code) {
  return Form. // The Form currently open
    formObject.
    FormLines. // The form elements on the form. Tests and assessments occupy one form line each
    find(fl => // Search through the form lines ("fl")
      fl.
      testValue?.  // Look inside each form line's testValue property. The next property may or may not exist, so we look with ?.
      test_header_code === test_header_code). // Check whether the test_header_code for the embedded test matches our searched code (again, if it exists.)
    testValue. // Take the matching testValue entry
    Questions. // Look inside the array of questions for the test
    find(q => q.output_code === question_code); // find a question with an output_code value that matches our question_code
}

function createTestAnswerOnClick(test_header_code, question_code, new_function) {
  let question = getTestQuestionByCode(test_header_code, question_code);// We need to reference the test question twice, so assigning it to a variable
  question. // Take the question we identified
    getField(). // Get the associated HTML element
    onclick = new_function; // Add the function we defined as an onclick action for the response button
}

//Use this for form fields and variables, which have columnName attributes
selectElementByColumnName = function(column_name) {
  return $(
    Form.
    getFormLineByColumnName(column_name).
    GetField()
  ).closest("div .form-group");
};

//Use this for labels, subforms, or subreports entered as form lines (not embedded in tests). Also works for form fields if field caption is preferred.
selectElementByCaption = function(caption) {
  return $(
    Form.
    getFormLineByCaption(caption).
    GetField()
  ).closest("div .form-group");
};

//Use this to get embedded tests by code
selectSubTest = function(test_code) {
  return $(
    Form.
    getTestFormLineByCode(test_code).
    GetField()
  ).closest("div .form-group");
};

//Use this to get a form group and its entire contents
selectFormGroup = function(group_caption) {
  return $(`#header-id-${
    Form.
    getFormLineByCaption(group_caption).
    formLinesId
  }`).
  closest("div.row");
};

//Use this to get a subreport embedded in a test
selectTestSubreport = function(subreport_caption) {
  return $(`div.QuestionContainer`).
    has(`label.testQuestionLabel:contains(${subreport_caption})`);
};

//Use this to get a whole group within a test and all its contents
selectTestGroup = function(test_code, group_caption) {
  let test_groups = $(
      Form.
      getTestFormLineByCode(test_code).
      GetField()
    ).
    closest("div .form-group").
    find("div div.clearfix").
    has("[question_type_code='']");
    
  return test_groups.
    has(`label:contains(${group_caption})`).
    nextUntil(test_groups).
    addBack();
};

function hideTestItem(test_header_code, question_code){
  try {
    var question_element = $( // Search this HTML element using JQuery
      getTestQuestionByCode(test_header_code, question_code). // find a question with an output_code value that matches our question_code
      getField() // Get the associated HTML element and give it to JQuery
    ).
    closest("div.QuestionContainer"). // Get the question container (contains both the prompt and the response(s). Look up the family tree for this element and take the first div.QuestionContainer element.
    hide();
  } catch {}
}

function showTestItem(test_header_code, question_code){
  try {
    var question_element = $( // Search this HTML element using JQuery
      getTestQuestionByCode(test_header_code, question_code). // find a question with an output_code value that matches our question_code
      getField() // Get the associated HTML element and give it to JQuery
    ).
    closest("div.QuestionContainer"). // Get the question container (contains both the prompt and the response(s). Look up the family tree for this element and take the first div.QuestionContainer element.
    show();
  } catch {}
}

createTestAnswerOnClick(
  "HideControl",
  "toggle", 
