      selectElementByCaption("Subreport Form Line").hide();
    } else {selectElementByCaption("Subreport Form Line").show()}
    if (Form.getTestAnswerValue("HideControl", "toggle", "Whole Test")) {
      selectSubTest("HideMe").hide();
    } else {selectSubTest("HideMe").show()}
