      hideTestItem("HideMe", "single_answer");
    } else {showTestItem("HideMe", "single_answer")}
    if (Form.getTestAnswerValue("HideControl", "toggle", "Multiple Responses")) {
      hideTestItem("HideMe", "multiple_answers");
    } else {showTestItem("HideMe", "multiple_answers")}
