      hideTestItem("HideMe", "date");
    } else {showTestItem("HideMe", "date")}
    if (Form.getTestAnswerValue("HideControl", "toggle", "Narrative")) {
      hideTestItem("HideMe", "narrative");
    } else {showTestItem("HideMe", "narrative")}
    if (Form.getTestAnswerValue("HideControl", "toggle", "Numeric")) {
      hideTestItem("HideMe", "numeric");
    } else {showTestItem("HideMe", "numeric")}
    if (Form.getTestAnswerValue("HideControl", "toggle", "Picklist")) {
